import React from 'react';
import textBoxStyle from './text-box.module.scss';

interface OwnProps {
    height: string,
    width: string
}

type Props = OwnProps;
const TextBox: React.FC<Props> = (props) => {
    return (
        <div className={textBoxStyle.Box} style={{ height: props.height, width: props.width }}>
            <div className={textBoxStyle.Text}>
                <div className={textBoxStyle.Title}>title</div>
                <div className={textBoxStyle.Content}>Content</div>
            </div>
            <div className={textBoxStyle.Icon}>ICON</div>

        </div>
    )
}

export default TextBox;
